import React from 'react';

const Header = () => (
  <h1
    style={{
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      fontFamily: 'Nunito Sans'
    }}
  >
    LaunchDarkly API Swap
  </h1>
);

export default Header;
